#include "gtest/gtest.h"
#include <vector>
#include <string>
#include <algorithm>

#include "22_GenerateParentheses.cpp"

struct ParamsAndExpectedResult
{
	int n;
	std::vector<std::string> result;
};

template<typename T>
bool EqualVector(const std::vector<T>& a, const std::vector<T>& b)
{
	if (a.size() != b.size())
		return false;

	// not a good solution
	std::vector<T> tmpa = a;
	std::vector<T> tmpb = b;

	std::sort(tmpa.begin(), tmpa.end());
	std::sort(tmpb.begin(), tmpb.end());

	for (int i = 0; i < tmpa.size(); ++i)
	{
		if (tmpa[i] != tmpb[i])
			return false;
	}
	return true;
}

TEST(GenerateParentheses, NormalTest)
{
	std::vector<ParamsAndExpectedResult> test_cases = 
	{
		{0, {""}},
		{1, {"()"}},
		{3,{"((()))","(()())","(())()","()(())","()()()"} },
	};

	for (int i = 0; i < test_cases.size(); ++i)
	{
		std::vector<std::string> actual = Solution().generateParenthesis(test_cases[i].n);
		
		EXPECT_TRUE(EqualVector(test_cases[i].result, actual))
			<< "Input: " << test_cases[i].n;
	}
}

